trng hp nhim tr&ugrave;ng do vi khun, nhim tr&ugrave;ng ng tiu, l&agrave;m l&agrave;nh vt thng.</span><br /><br /><span style="font-size: small;">- Gi&uacute;p ph&aacute;t trin tt th lc, tr&iacute; tu minh mn, tng cng nh&atilde;n lc, l&agrave;m s&aacute;ng mt.</span><br /><br /><span style="text-decoration: underline;"><span style="font-size: small;">Th&agrave;nh Phn</span></span><br /><br /><span style="font-size: small;">- 100% t thi&ecirc;n nhi&ecirc;n.</span><br /><br /><span style="font-size: small;">- Vitamin nh&oacute;m A, B, C, D v&agrave; E; gm 18 amino acids, Protein v&agrave; acid b&eacute;o v&agrave;o 10-HDA gi&uacute;p t&aacute;i to l&agrave;n da mang n cho bn 1 l&agrave;n da mn m&agrave;ng v&agrave; kho mnh.</span><br /><br /><span style="font-size: small;"><span style="text-decoration: underline;">C&aacute;ch d&ugrave;ng</span>: Ng&agrave;y ung 01 ln v&agrave;o bui s&aacute;ng trc khi n. </span></p>', '', 800000, 700000, 'SOC1', 1, '0', 0, 0, '0', '1', '1', 1393850179),
(126, 75, 'Well Being Nutrition', 'Sa Ong Cha Royal Jelly Wellbeing Nutrition 1600mg (365 vin)', 'sa-ong-cha-royal-jelly-wellbeing-nutrition-1600mg-365-vin', 'Xut x : Well Being Nutrition - Australia.\r\nThc y tng hp glycogen, thc y qu trnh trao i cht, gim thm nm, tn nhang. Gip tr ha v gi mi nt thanh xun cho ch em ph n.', '<p><span style="font-size: small;"><strong style="font-size: small;">Sa Ong Ch&uacute;a Royal Jelly Wellbeing Nutrition 1600mg (365 vi&ecirc;n)</strong></span></p>\r\n<p><span style="font-size: small;"><strong>Hin nay, tr&ecirc;n th trng c&oacute; rt nhiu sa ong ch&uacute;a Trung Quc, do ngi bu&ocirc;n t c&aacute;c thng l&aacute;i Trung Quc l&agrave;m, n&ecirc;n kh&aacute;ch h&agrave;ng h&atilde;y tht cn thn , tr&aacute;nh t&igrave;nh trng " Tin mt tt mang nh&eacute;".</strong></span></p>\r\n<p><span style="font-size: small;"><strong>Sa Ong Ch&uacute;a gi&uacute;p bi b sc khe, chng l&atilde;o h&oacute;a da gi&uacute;p c th tr l&acirc;u, gi&uacute;p da t&oacute;c mn m&agrave;ng, nga mn, t&agrave;n nhang</strong>. Chng mt mi, trm cm l&agrave;m vic qu&aacute; sc, suy nhc, lo lng k&eacute;o d&agrave;i, mt ng, bing n.</span></p>\r\n<p><span style="font-size: small;">C&ocirc;ng dng Sa Ong Ch&uacute;a? </span></p>\r\n<p><span style="font-size: small;">1.C&oacute; cha axit pantothenic, gi&uacute;p ci thin v&agrave; ngn nga c&aacute;c triu chng ca bnh thp khp. </span></p>\r\n<p><span style="font-size: small;">2.C&oacute; cha acetylcholine, iu tr hiu qu c&aacute;c bnh v tim mch Ci thin h thng min dch, tng cng chc nng sn sinh hng cu c&oacute; li cho s tng trng v&agrave; ph&aacute;t trin sc khe  thanh thiu ni&ecirc;n.</span></p>\r\n<p><span style="font-size: small;">3.iu h&ograve;a ni tit t trong c th  iu tr ri lon m&atilde;n kinh v&agrave; bnh vi&ecirc;m tuyn tin lit m&atilde;n t&iacute;nh. </span></p>\r\n<p><span style="font-size: small;">4.C&oacute; cha insulin, tt cho bnh nh&acirc;n ang b tiu ng. </span></p>\r\n<p><span style="font-size: small;">5.C&oacute; nhiu loi Peptide v&agrave; protein tt cho sc khe, th&uacute;c y s ph&aacute;t trin tr&iacute; tu, ci thin tr&iacute; nh.</span></p>\r\n<p><span style="font-size: small;">6.Tng cng th trng, l&agrave;m p da, chng l&atilde;o h&oacute;a, ci thin s bing n ca c th. <strong>Th&uacute;c y tng hp glycogen, th&uacute;c y qu&aacute; tr&igrave;nh trao i cht, gim th&acirc;m n&aacute;m, t&agrave;n nhang. Gi&uacute;p tr h&oacute;a v&agrave; gi m&atilde;i n&eacute;t thanh xu&acirc;n cho ch em ph n</strong> gi&uacute;p mn v&agrave; l&agrave;m cng l&agrave;n da , x&oacute;a vt th&acirc;m , t&agrave;n nhang ,gi v&oacute;t d&aacute;ng sn chc gn g&agrave;ng v&igrave; cha nhiu c&aacute;c sinh t - kh&oacute;ang cht cn thit cho c th cng th&ecirc;m 22 loi Amino Acid kh&aacute;c. Nhiu protein gi&uacute;p kh&ocirc;i phc li sc sng cho l&agrave;n da. Sa ong ch&uacute;a tng cng hot ng t&igrave;nh dc cho nam gii, sau khi s dng sa ong ch&uacute;a c&oacute; cha c&aacute;c k&iacute;ch th&iacute;ch t sinh dc ci thin ham mun t&igrave;nh dc ca nam gii ln ph n, cng c&oacute; th l&agrave;m chm c&aacute;c chc nng l&atilde;o h&oacute;a. Sa ong ch&uacute;a c&oacute; th ci thin kh nng di chuyn ca tinh tr&ugrave;ng bi v&igrave; trong &oacute; c&oacute; cha adenosine triphosphate ( ATP ) c&ugrave;ng vi nc v&agrave; ng hot t&iacute;nh, gi&uacute;p tng cng nng lng di chuyn ca tinh tr&ugrave;ng.</span></p>', '', NULL, 950000, 'SOC2', 1, '0', 0, 0, '0', '1', '1', 1393859687);
